const printToDom = (selector, textToPrint) => {
  console.log('in printToDom', selector , textToPrint)
  document.querySelector(selector).innerHTML = textToPrint;
}

//shorten this
  const duckCardsBuilder = (array) => {
    let domString = ''
    for (let i = 0; i < array.length; i++){
      domString += `<div class= "${array[i].breed}" id = "duck">`
      domString += `<img src="${array[i].imageUrl}" alt="${array[i].name} ">`;
      domString += `<h3>${array[i].name}</h3>`;
      domString += `<h3>${array[i].breed}</h3>`;
      domString += `<h3>${array[i].size}</h3>`;
      domString += `<h3>${array[i].temeperament}</h3>`;
      domString += `<h3>${array[i].gender}</h3>`;
      domString += `<h3>${array[i].age}</h3>`;
      domString += `<h3>${array[i].isRubber}</h3>`;
      domString +=  `</div>`;
    }
    printToDom('#duckCards', domString)
  }

